import react from "react";
import {Link} from "react-router-dom";
import styled from "styled-components";

const Navbar = () => {
    const handleChangeSelection = (value) => {
        console.log(value);
        window.location.href = String("/" + value);
    };
    const StyledLink = styled(Link)`
    display: inline-block;
    position: relative;
    margin: 20px;
    color:royalblue;
    text-decoration: none;
    font-family: "Times New Roman", Times, serif;
    &:hover{
        color:skyblue;
    }
    `;
    return (
        <nav className="navbar-expand navparent">
            <div className="navbar nav1">
                <div className="navbar nav1">
                    <ul className="navbar-nav mr-auto nav1">
                        <div>
                            <li>
                                <StyledLink to="/home" className="navbar-brand navbar-item"><h1 className="h1">homepage</h1></StyledLink>
                            </li>
                        </div>
                        <div>
                            <li>
                                <StyledLink to="/signin" className="navbar-brand navbar-item"><h1 className="h1">Sign in</h1></StyledLink>
                            </li>
                        </div>
                        <div className="">
                            <li className="">
                                <select className=" navbar-brand navbar-item dropdown" onChange={event => handleChangeSelection(event.target.value)}>
                                    <option className="options" value="">Select</option>
                                    <option className="options" value="signin">Sign in</option>
                                    <option className="options" value="home">Home</option>
                                    <option className="options" value="reeses">Reeses</option>
                                </select>
                            </li>
                        </div>
                    </ul>
                </div>
            </div>
        </nav>
    )
}

export default Navbar;
